      type: "product",
      products: [
        {
          id: 71814,
          title: "Gerber Graduates Yogurt Melts Mixed Berries",
          image: "https://spoonacular.com/productImages/71814-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 183761,
          title: "Gerber Organic Yogurt Melts Red Berries",
          image: "https://spoonacular.com/productImages/183761-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 183768,
          title: "Gerber Organic Yogurt Melts Banana Strawberry",
          image: "https://spoonacular.com/productImages/183768-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 12369,
          title: "Gerber Graduates Yogurt Melts Yogurt - Peach Yogurt Melts",
          image: "https://spoonacular.com/productImages/12369-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 52828,
          title:
            "Gerber Yogurt Blends Snack Strawberry Banana / Toddler - 4 PK",
          image: "https://spoonacular.com/productImages/52828-312x231.jpg",
          imageType: "jpg",
        },
