          id: 183684,
          title:
            "Sprout Organic Toddler Snacks Yogurt Bites Banana Pumpkin Yogurt",
          image: "https://spoonacular.com/productImages/183684-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 214146,
          title:
            "La Yogurt Original Variety Pack Lowfat Yogurt - Strawberry & Peach Blended",
          image: "https://spoonacular.com/productImages/214146-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 20782,
          title:
            "La Yogurt Lite &amp; Sensible Probiotic Strawberry Banana Blended Nonfat Yogurt, 6 oz",
          image: "https://spoonacular.com/productImages/20782-312x231.jpeg",
          imageType: "jpeg",
        },
        {
          id: 415957,
          title:
            "Go-GURT Unicorn Low Fat Yogurt Variety Pack, 16 Ct, 2 OZ Yogurt Tubes",
          image: "https://spoonacular.com/productImages/415957-312x231.jpg",
          imageType: "jpg",
        },
        {
          id: 219478,
          title:
            "Yoplait Kids Yogurt, Disney Frozen Strawberry and Blueberry Yogurt, 8 Cups",
          image: "https://spoonacular.com/productImages/219478-312x231.jpeg",
          imageType: "jpeg",
        },
      ],
      offset: 0,
      number: 10,
      totalProducts: 18620,
      processingTimeMs: 196,
    };

    const data = await api.json();
    setPopular(data.recipes);
    // console.log(data);
  };
  // const APIKEY = "943095ffd9b94a21ae71c4a7a61c6acc";
  return (
    <>
      {popular.map((recipes) => {
        return (
          <div className="col">
            <div className="card">
              <img
                src={recipes.image}
                className="card-img-top"
                alt="Hollywood Sign on The Hill"
              />
              <div className="card-body">
                <h5 className="card-title">{recipes.title}</h5>
                {/* <p className="card-text">{recipes.summary}</p> */}
              </div>
            </div>
          </div>
        );
      })}
    </>
  );
}
